INSERT INTO `news` VALUES
(1, '購買課のお知らせ', '※日立製品は仮発注不可です。\r\n※離島納品の際は〇〇区、〇〇町まで記載してください。(送料・納期が変わります）\r\n※機器(部材)名称ではなく正式な型番で在庫確認依頼お願いします。\r\n※17時以降は翌日以降の回答となる場合があります。\r\n11/2：日立製品パッケージ、ビルマルの8馬力以上は2023年2月納期です。', NULL, NULL);
