(1, 1, 16, 125, '273013-20240627-0612621241-RCI-GP140RSH9', 259134, 4, '時間指定希望の場合は有料での対応です。（メーカーによる）:時間指定は不要です（終日対応）\n事前、当日の問合番号・時間確認の対応は出来かねます。:問合番号・時間確認不可を了承した\n4トントラックでの配送、荷台上での商品お引き渡しです。:荷下ろし必要の旨了承した\n配達時ご不在の場合は持ち戻り・再配達料をご請求します。:不在時は費用発生の旨了承する\n不在時の置き配は対応できかねます。:不在置き不可の旨了承した\nパネルをお選び下さい:ブラック', 'ワイヤード', '[《 お願い 》納品時に常時つながる、携帯電話などのご連絡先をご記入ください。手配完了後に送付する「お届け日お知らせ」メール内リンクから明細付き領収書のダウンロードができます。:]\n例 携帯電話：090-1234-5678\n', 'supplier', 0, 0, 0, 1, 0, '2024-06-27 11:40:53', '2024-06-27 11:40:53'),
